nge = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"675502","type":"CustomJS"},{"attributes":{"data":{"Close":{"__ndarray__":"mpmZmZmZRUBcj8L1KAxFQJqZmZmZQUVAAAAAAACoRUCuR+F6FI5FQBSuR+F6xEVAj8L1KFzXRUAK16NwPfpFQEjhehSuR0ZAexSuR+E6RkCamZmZmZlFQNejcD0Kt0RASOF6FK6nRECuR+F6FF5EQM3MzMzMdERA16NwPQqHREAK16NwPUpEQLgehetRqERAMzMzMzMjRUAK16NwPRJGQBSuR+F6HEZAw/UoXI/6RkCF61G4HiVHQJqZmZmZQUdA7FG4HoVrR0DhehSuR8FHQHsUrkfhkkdAzczMzMyER0CuR+F6FE5HQPYoXI/ChUdASOF6FK5fR0BSuB6F60lHQFyPwvUodEdAhetRuB5lR0DsUbgehYtHQM3MzMzMhEdAw/UoXI+SR0DNzMzMzHxHQAAAAAAAcEdApHA9CtdbR0BI4XoUrsdHQMP1KFyP+kdAUrgehespSECPwvUoXD9IQB+F61G4LkhAZmZmZmb2R0CPwvUoXOdHQClcj8L1CEhAZmZmZmbWR0CamZmZmdlHQHsUrkfhmkdASOF6FK6XR0CuR+F6FDZHQAAAAAAAUEdAH4XrUbguR0A9CtejcB1HQD0K16NwxUZA9ihcj8INR0CF61G4HgVHQAAAAAAAMEdA7FG4HoUjR0D2KFyPwmVHQD0K16Nw/UZAzczMzMwsR0DXo3A9Cn9HQMP1KFyP0kdAMzMzMzPLR0Bcj8L1KHxH
